import React from 'react';
import style from './ContactList.module.css';

const ContactList = contacts => {
  return (
    <div>
      <ul>
        {contacts.map(contact => {
          <li key={contact.id}>
            {contact.name} : {contact.number}
            <button type="button">Delete</button>
          </li>;
        })}
      </ul>
    </div>
  );
};

export default ContactList;
